import json
import sys
import re

def extract_interpreter_name(shebang_line):
    pattern = r'#!.*\bpython(\d+)\b'
    match = re.search(pattern, shebang_line)
    if match:
        return match.group(1)
    return None

def validate_shebang_line(shebang_line):
    interpreter_name = extract_interpreter_name(shebang_line)
    if not interpreter_name:
        return {
            "error_message": "Invalid input"
        }
    if int(interpreter_name) >= 2 and int(interpreter_name) <= 3:
        return {
            "valid": True
        }
    else:
