import json
import sys
import subprocess

def install_packages(json_input):
    packages = json_input.get('packages', [])
    install_status = {}
    for package in packages:
        try:
            result = subprocess.run(['pip', 'install', package], capture_output=True, text=True)
            if result.returncode == 0:
                install_status[package] = True
            else:
                install_status[package] = False
        except Exception as e:
            install_status[package] = str(e)
    return {'install_status': install_status}

def main():
    input_data = json.load(sys.stdin)
    result = install_packages(input_data)
    print(json.dumps(result))

if __name__ == "__main__":
    main()

